// src/components/Cart.js
import React from 'react';
import './Cart.css';

function Cart({ items }) {
  return (
    <div className="cart">
      <h2>Tu Carrito</h2>
      {items.map((item, index) => (
        <div key={index} className="cart__item">
          <p className="cart__item-name">{item.name}</p>
          <p className="cart__item-quantity">Cantidad: {item.quantity}</p>
        </div>
      ))}
    </div>
  );
}

export default Cart;
